import React from "react";
import { Card, Input, Dropdown, Radio, Button,Form } from "antd";
const items = [
  {
    key: "1",
    label: <a>India</a>,

  },{
    key:"2",
    label:<a>UK</a> ,
  },{
    key:"3",
    label:<a>US</a> ,
  }
];
const UserDetail = () => {
  return (
    <div>
      <Card
        borderd={true}
        style={{
          width: 800,
          height: 900,
          borderColor: "black",
          justifyContent: "center",
          alignContent: "center",
          display: "flex",
        }}
      >
        <Form>
            <Form.Item>
        <Input
          placeholder="FirstName"
          style={{ lineHeight: 3, marginBottom: 12 }}
        /></Form.Item>
        <Input
          placeholder="LastName"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />
        <Input
          placeholder="Contact"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />

        <Input
          placeholder="Email"
          style={{ lineHeight: 3, marginBottom: 12 }}
        />
        <Input placeholder="City" style={{ lineHeight: 3, marginBottom: 12 }} />
        <Dropdown
          menu={{ items }}
          placement="bottomLeft"
          style={{ lineHeight: 3, marginBottom: 20 }}
          arrow={{ pointAtCenter: true }}
        >
          <Button>Country</Button>
        </Dropdown>
         <Radio style={{marginLeft:50}}>IsActive</Radio>
         </Form>
      </Card>
    </div>
  );
};

export default UserDetail;
